import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input and enter a product name
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Apple iPhone 15 Pro Max');

    // Take screenshot after filling the search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Wait for the wishlist link and click it
    await page.waitForSelector('a:has-text("Your Wish List")', { timeout: 5000 });
    await page.click('a:has-text("Your Wish List")');

    // Take screenshot after navigating to the wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_navigated_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_navigated_to_wishlist.png'));

    // Click on the add to wishlist button for the product
    await page.waitForSelector('button.add-to-wishlist', { timeout: 5000 });
    await page.click('button.add-to-wishlist');

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_added_to_wishlist.png'));

    return {
      success: true,
      action: "Added product to wishlist",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
